import React from "react";

export default function HeaderNav() {
  return (
    <React.Fragment>
      <nav style={{ height: "25px", textDecoration: "none", listStyle: "none" }} className="container">
        <ul>
          <li>Account</li>
        </ul>
      </nav>
    </React.Fragment>
  );
}
